import React, { useState, useEffect } from 'react';
import { Table, Spinner } from 'react-bootstrap';

function HistoricoConsultas() {
    const [consultas, setConsultas] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Simulação de uma chamada de API para buscar o histórico de consultas do paciente
        const fetchConsultas = async () => {
            try {
                // Aqui você pode substituir pela chamada real à sua API
                const response = await fetch('/api/consultas'); // Exemplo de URL
                const data = await response.json();
                setConsultas(data);
            } catch (error) {
                console.error("Erro ao buscar histórico de consultas:", error);
            } finally {
                setLoading(false);
            }
        };

        fetchConsultas();
    }, []);

    if (loading) {
        return <Spinner animation="border" />;
    }

    return (
        <div>
            <h3>Histórico de Consultas</h3>
            {consultas.length === 0 ? (
                <p>Você ainda não tem consultas registradas.</p>
            ) : (
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>Data da Consulta</th>
                            <th>Médico</th>
                            <th>Motivo</th>
                            <th>Resultado</th>
                        </tr>
                    </thead>
                    <tbody>
                        {consultas.map((consulta, index) => (
                            <tr key={index}>
                                <td>{consulta.dataConsulta}</td>
                                <td>{consulta.medico}</td>
                                <td>{consulta.motivo}</td>
                                <td>{consulta.resultado}</td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
            )}
        </div>
    );
}

export default HistoricoConsultas;
